package com.dingapp.biz.db.orm;public class MsgListBean {	private String title;	private String msg_id;	private String content;	private String create_time;	public String getTitle() {		return title;	}	public void setTitle(String title) {		this.title = title;	}	public String getMsg_id() {		return msg_id;	}	public void setMsg_id(String msg_id) {		this.msg_id = msg_id;	}	public String getContent() {		return content;	}	public void setContent(String content) {		this.content = content;	}	public String getCreate_time() {		return create_time;	}	public void setCreate_time(String create_time) {		this.create_time = create_time;	}}